import React from 'react'

const Main = () => {

    const handleChangeFile = (e) => {
        e.preventDefault();
        let file = e.target.files[0]
        console.log(file)
    }

    return (
        <>
            <div>
                Main
        </div>

            <input className="file-button" type="file" onChange={e => handleChangeFile(e)} />

        </>
    )
}

export default Main
